import React from 'react';
import * as d3 from 'd3';

export default class Titles extends React.PureComponent {
  constructor(props) {
    super(props);
    this.references = { title: React.createRef() };
  }

  componentDidMount() {
  }


  render() {
    return (
      <text ref={this.references.title}
        x= "25%"
        y= "10%"
        width="50%"
        text="Zwarte mensen"
      />
    );
  }
}
